import axios from "axios";
export default function ContentBody({ topic, getTopics, id, deleteTopic }) {
  // State

  //Functions

  function deleteTopic() {
    try {
      axios.delete(`http://localhost:8000/api/${topic.id}`);
    } catch (err) {
      console.log(err);
    }
    getTopics();
  }
  return (
    <div key={id} className='Body-Container'>
      <p>{topic.topicTitle}</p>
      <button onClick={deleteTopic}>X</button>
    </div>
  );
}
